// src/pages/MedicalVacationPage.js
import React from 'react';
import './MedicalVacationPage.css';
import medicalVacationImage from './images/medical-vacation.jpg';

const MedicalVacationPage = () => {
  return (
    <div className="medical-vacation-page">
      <h1>Medical Vacation</h1>
      <img src={medicalVacationImage} alt="Medical Vacation" className="header-image" />
      <div className="content">
        <section>
          <h2>Our Concept</h2>
          <p>We offer comprehensive medical vacation services that combine healthcare with relaxation. Our facilities are equipped with state-of-the-art technology and staffed by experienced professionals.</p>
        </section>
        <section>
          <h2>History</h2>
          <p>Since our inception, we have been dedicated to providing exceptional medical care in a serene environment. Our history is marked by continuous improvement and a commitment to patient satisfaction.</p>
        </section>
      </div>
    </div>
  );
};

export default MedicalVacationPage;
